column8:
キャンピングカーの照明をLED化！<br>

<TABLE border="0" width="600" cellpadding="0" cellspacing="0">

    <TR>
      <TD><BR>
      <img src="https://image.rakuten.co.jp/ikoro-solar/cabinet/led/bousuimain.jpg" width="600" border="0" alt="DC12V LED"><BR>
      <BR>
      DC12V入力で点灯するLEDモジュールです。<BR>
      キャンピングカー等の照明などにも使用可能です。<BR>
      <BR>
      IP68防水認証を取得で屋外使用も可能です。<BR>
      <BR>
      キャンピングカー独特のハロゲンも柔らかな光で良いのですが、<BR>
      比較するとこんなに違うものです。<br>
      <BR>
      <BR>
      <IMG src="https://image.rakuten.co.jp/ikoro-solar/cabinet/light/sumled3.jpg" width="600" height="224" border="0" alt="DC12V LED キャンピングカー等に"><BR>
      <BR>
      左がハロゲン10Wを2球使用 右が白色LED3モジュール、電球色LED3モジュールの組み合わせ<BR>
      <BR>
      <IMG src="https://image.rakuten.co.jp/ikoro-solar/cabinet/light/sumled2.jpg" width="600" height="148" border="0" alt="DC12V LED キャンピングカー等に"><BR>
      <BR>
      LEDの色の比較をしてみました。<BR>
      <BR>
      白色モジュール3灯だと、少々暗い感じがします。<BR>
      電球色モジュール3灯だと、ハロゲン2灯と同等またはやや明るいイメージです。<BR>
      3灯ずつの組み合わせで、明るく、色が本来の色に見えるイメージです。<BR>
      <BR>
      <BR>
      電球色をお好みな方は、ハロゲン10Wクラス 2球の照明であれば、<BR>
      電球色を4モジュール程度つけると明るく感じるでしょう。<BR>
      <BR>
      元々内照式看板等に使用されているLEDです。<br>
      防水なので、サイドオーニングに取り付けも可能です。<br>
      ご希望であれば50個まで接続した状態でお届けも可能です。<BR>
      <BR>
      <img src="https://image.rakuten.co.jp/ikoro-solar/cabinet/led/dc12v_led_siyou.jpg" border="0" alt="DC12V LED キャンピングカー等に"><BR>
      <TABLE width="597" border="0" cellspacing="1" cellpadding="3">

          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">LED素子</FONT></TD>
            <TD>LG電子 3LED</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">駆動電圧</FONT></TD>
            <TD>DC12V</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">消費電流</FONT></TD>
            <TD>60mA</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">消費電力</FONT></TD>
            <TD>0.72W</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><font color="#ffffff">色温度</font></TD>
            <TD>白色6,500k 電球色3,000k</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">照射角</FONT></TD>
            <TD>145°</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">サイズ</FONT></TD>
            <TD>L：70mm　W：15mm　H：8.5mm</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">モジュール輝度（mcd）</FONT></TD>
            <TD>21,000mcd　以上</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">防水</FONT></TD>
            <TD>IP68防水認証</TD>
          </TR>
          <TR>
            <TD bgcolor="#3a3a3a"><FONT color="#ffffff">備考</FONT></TD>
            <TD>本体に3cm程度のケーブル付き(極性あり)</TD>
          </TR>

      </TABLE>
<br><br>
<img src="https://image.rakuten.co.jp/ikoro-solar/cabinet/led/gl_size.jpg">
<br><br>
      ※本体のプリント等デザインが変わる場合がございます。予めご了承ください。<BR>
      <BR>
      <BR>
      <BR>
      両タイプ共に背面に両面テープが付いております。<BR>
      <BR>
      <IMG src="https://image.rakuten.co.jp/ikoro-solar/cabinet/light/sumledmain.jpg" width="600" height="450" border="0" alt="DC12V LED キャンピングカー等に"><BR>
      <br>
      </TD>
    </TR>

</TABLE>≪ご注意≫<br>
本製品は、DC12V用製品であり、一部ハロゲンライトを使用したAC12V機器には使用できません。<br>
※白色タイプにつきましては照明面の四隅が少々丸みを帯びたカットになりました。<br>
※ご注文個数に応じて本体間(約9cm程度のケーブル)を連結状態でお送りする場合があります。<br><br>

